import logo from './logo.svg';
import './App.css';
import SignInButton from './SignInButton';

function App() {
  return (
    <div className="App">
      <header className="App-header">
        <img src={logo} className="App-logo" alt="logo" />
        <p>
          <SignInButton label="Click Me" onClick={handleClick} style={{ padding: '10px', backgroundColor: 'blue', color: 'white' }} />
        </p>
        <a
          className="App-link"
          href="https://reactjs.org"
          target="_blank"
          rel="noopener noreferrer"
        >
          Learn React
        </a>
      </header>
    </div>
  );
}

export default App;
